import React from "react";
import Card from "./Card";
import data from "../data/card-data";

function createCard(item){
    return (
        <Card 
            name= {item.name}
        />
    )
}

function Main(){
    return(
        <div id="intro-section">
        <div class="container-fluid">
        <div class="row">
                <div class="col-lg-4">
                    {data.map(createCard)}
                </div>
            </div>
        </div>
            
            
        </div>
    )
}

export default Main;
